import React from 'react';

function BoardHead() {
    return (
        <tr>
            <th>번호</th>
            <th>제목</th>
            <th>작성자</th>
            <th>작성일자</th>
            <th>조회수</th>
        </tr>
    );
}

export default BoardHead;
